import logo from './logo.svg';
import './App.css';




function App() {
  return (
    <div className="App">
        <TitleBar />
      <Routes>
        <Route path="/" exact element={<Create/>} />
        <Route path="/home" element={<HomePage/>} />
        <Route path="/login" element={<Login />} />
        {/* {<Route path="/shoppingcart" element={<ShoppingCart/>} /> } */}
      </Routes>
    </div>
  );
}

export default App;
